import React, { Component } from 'react';
import Navbar from "./Navbar";
import RecipeApp from "./RecipeApp";
import List2App from "./List2"

class App extends Component {
  render() {
    return (
      <div id="app">
      <Navbar />
      <div id="recipes"><RecipeApp /></div>
      <div id="grocs"><List2App /></div>


      </div>
    )
  }
}

export default App
